import React from 'react'
import styled from 'styled-components'
import colors from '../src/app/colors'
import user from '../src/app/user'
// components
import Header from '../src/components/Header'
import Office from '../src/components/Office'
import Services from '../src/components/Services'
import About from '../src/components/About'
import Form from '../src/components/Form'
import Conquest from '../src/components/Conquest'
import Footer from '../src/components/Footer'
// images

export default function Home() {
  return (
    <Container>

      <Header />
      <Office />
      <Conquest />
      <Services />

      <WhatsappContainer href={user.whatsapp} target="_blank">
        <WhatsappIcon src='/static/whatsapp-logo.png' />
      </WhatsappContainer>

      <Footer />

    </Container>
  )
}

const Container = styled.div`
`

const FormTitleContainer = styled.div`
  display: flex;
  align-items: center;
  justify-content: center;
  flex-direction: column;
  margin-bottom: 100px;
  margin-top: 100px;
`

const FormTitle = styled.h5`
  color: #2f314a;
  font-family: 'Montserrat', sans-serif;
  font-weight: bolder;
  font-size: 1.8em;
  text-transform: uppercase;
`

const WhatsappContainer = styled.a`
  background-color: #3abf4c;
  position: fixed;
  z-index: 999999;
  right: 20px;
  bottom: 20px;
  padding: 12px;
  border-radius: 100px;
  display: flex;
  justify-content: center;
  align-items: center;
  box-shadow: 1px 1px 6px rgba(0,0,0,0.4);
  cursor: pointer;
  @media(min-width: 600px) {
    right: 40px;
    bottom: 40px;
    padding: 15px;
  }
`
const WhatsappIcon = styled.img`
  z-index: 999999;
  height: 30px;
  width: 30px;
`
